let hostname = 'http://localhost:8081';


let register = (user) => {
    const requestOptions = {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(user)
    };

    return fetch(`${hostname}/user/signup`, requestOptions)
}

export const userService = {
    register,
};
